const initiialState ={
    mount : false
};

export const Body  = function(){
    const [state,setState] =React.useState(initiialState);
    const onBtnClick=()=>{
        setState({
            ...state,
            mount : true,
        })
    }
    return(
        <div className='body-container'> {`mount -${state.mount}`};
           <button onClick={onBtnClick}>button</button>
        </div>
    )
}
